Ext.data.JsonP['PyDev_Context-insensitive_completions']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>PyDev Context-insensitive completions</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-30083072\" class=\"content\">\n                        <h1>PyDev Context-insensitive completions</h1>\n    <p>The &apos;context-insensitive&apos; code completion brings up completions with tokens found it the pythonpath and automatically imports the module that contains that token when selected.    </p>\n    <p>It is shown only when the completion is requested for the globals and 3 characteres are already typed.    </p>\n    <p><strong class=\" \">NOTE:</strong> You need to request the completions to show with <strong class=\" \">Ctrl+Space</strong>    </p>\n    <p>    <img src=\"images/pydev.org/images/completion/complnoctx.png\" alt=\"images/pydev.org/images/completion/complnoctx.png\" class=\"confluence-embedded-image confluence-external-resource confluence-content-image-border\">\n        </img></p>\n    <p><strong class=\" \">Image:</strong> All the tokens that start with &apos;xml&apos; in the pythonpath    </p>\n    <p>    <img src=\"images/pydev.org/images/completion/complnoctx2.png\" alt=\"images/pydev.org/images/completion/complnoctx2.png\" class=\"confluence-embedded-image confluence-external-resource confluence-content-image-border\">\n        </img></p>\n    <p><strong class=\" \">Image:</strong> Result of selecting the &apos;XMLFilterBase&apos; token    </p>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083072\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"PyDev Context-insensitive completions"});